    isPrimitive: true
    uid: BigInt
  - name: b
    summary: Az összehasonlítandó második érték.
    isPrimitive: true
    uid: BigInt
output:
  content: Bool
  types:
  - summary: '`true` Ha és csak akkor, ha `a` nem egyenlő `b` .'
    isPrimitive: true
    uid: Bool
